import {UseState} from "react";

const Example = () => {

  let valArray = UseState("hello");
  console.log(valArray);
  return (
    <>
      <input
       type="text"
       onChange={(e) => {
        displayVal = e.target.value
       }} /> = {displayVal}
    </>
  );
};

export default Example;
